package leetcode.primary.string

import org.scalatest.funsuite.AnyFunSuite

class ReverseStringTest extends AnyFunSuite {

  test("hello") {
    val str = "hello"
    val result = ReverseString.reverseString(str)
    assert(result.equals(str.reverse))
  }

  test("aaa") {
    val str = "aaa"
    val result = ReverseString.reverseString(str)
    assert(result.equals(str.reverse))
  }

  test("empty string") {
    val str = ""
    val result = ReverseString.reverseString(str)
    assert(result.equals(str.reverse))
  }

